export async function compute(values, displayParams) {
  let data = JSON.stringify({ values: values, bucketKey: 'stringPDB.gh' })
  try {
    const response = await fetch('/api/loadGrasshopper', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: data
    });
    const responseData = await response.text();
    const responseJson = JSON.parse(responseData);
    return (await collectResults(responseJson, displayParams));
  } catch (error) {
    console.error(error);
    return true;
  }
};


let doc

/**
 * Parse response
 */
export async function collectResults(responseJson, displayParams) {

  const values = responseJson.values
  //clear doc
  if (doc != undefined) {
    doc = null;
  }

  if(rhino == undefined) {
    rhino = await rhino3dm();
  }

  doc = new rhino.File3dm()
  // for each output (RH_OUT:*)...
  for (let i = 0; i < values.length; i++) {
    
    // ...iterate through data tree structure...
    for (const path in values[i].InnerTree) {
      const branch = values[i].InnerTree[path]
      // ...and for each branch...
      for (let j = 0; j < branch.length; j++) {
        // ...load rhino geometry into doc
        const rhinoObject = decodeItem(branch[j])
        if (rhinoObject !== null) {
          doc.objects().add(rhinoObject, null)
        }
      }
    }
  }

  if (doc.objects().count < 1) {
    console.error('No rhino objects to load!')
    throw new Error('No rhino objects to load!');
  }
  await rhinoToThree(displayParams);

  return false;
}

export async function rhinoToThree(displayParams) {
  // load rhino doc into three.js scene
  if (doc) {
    const buffer = new Uint8Array(doc.toByteArray()).buffer
    loader.parse(buffer, function (object) {
      let mapIntensity = 1.0; 
      if(displayParams['Material']=='plastic'){
        mapIntensity = 0.5;
      }
      let material = new THREE.MeshStandardMaterial({
        color: displayParams['Color'],
        envMap: exrCubeRenderTarget.texture,
        metalness: displayParams['Reflectivity'],
        roughness: displayParams['Roughness'],
        flatShading: false,
        envMapIntensity: mapIntensity,
        emissive: '#000000',
        emissiveIntensity: 1,
      });

      let hookColor = '#F7D498'
      if(displayParams['Material']=='metal'){
        hookColor = displayParams['Color'];
      } 

      let hookMaterial = new THREE.MeshStandardMaterial({
        color: hookColor,
        envMap: exrCubeRenderTarget.texture,
        metalness: 1.0,
        roughness: 0.0,
        flatShading: false,
        envMapIntensity: 1.0,
      })
      object.children[0].material = material; 
      object.children[1].material = hookMaterial;

      // Clone the original object
      const duplicateObject = object.clone();

      // Set the scale to flip horizontally
      duplicateObject.scale.x = -1;

      const boundingBoxOriginal = new THREE.Box3().setFromObject(object);
      const boundingBoxDuplicate = new THREE.Box3().setFromObject(duplicateObject);
      const widthOriginal = boundingBoxOriginal.max.x - boundingBoxOriginal.min.x;
      const widthDuplicate = boundingBoxDuplicate.max.x - boundingBoxDuplicate.min.x;
      
      // Calculate the required translation for the duplicate to align with the original (last term to handle cloning offset)
      const translation = widthOriginal + widthDuplicate + (boundingBoxOriginal.max.x-boundingBoxDuplicate.max.x);
      duplicateObject.position.x += translation;
      
      scene = new THREE.Scene();
      scene.add(object);
      scene.add(duplicateObject);

      // zoom to extents
      zoomCameraToSelection(camera, controls, [object,duplicateObject])
    }, function (error) {
      // Error callback
      console.error(error);
    })
  }
}

/**
 * Attempt to decode data tree item to rhino geometry
 */
function decodeItem(item) {
  const data = JSON.parse(item.data)
  if (item.type === 'System.String') {
    // hack for draco meshes
    try {
      return rhino.DracoCompression.decompressBase64String(data)
    } catch { } // ignore errors (maybe the string was just a string...)
  } else if (typeof data === 'object') {
    return rhino.CommonObject.decode(data)
  }
  return null
}

/**
 * Helper function that behaves like rhino's "zoom to selection", but for three.js!
 */
function zoomCameraToSelection(camera, controls, selection, fitOffset = 1.1) {

  const box = new THREE.Box3();

  for (const object of selection) {
    if (object.isLight) continue
    box.expandByObject(object);
  }

  const size = box.getSize(new THREE.Vector3());
  const center = box.getCenter(new THREE.Vector3());

  const maxSize = Math.max(size.x, size.y, size.z);
  const fitHeightDistance = maxSize / (2 * Math.atan(Math.PI * camera.fov / 360));
  const fitWidthDistance = fitHeightDistance / camera.aspect;
  const distance = fitOffset * Math.max(fitHeightDistance, fitWidthDistance);

  const direction = controls.target.clone()
    .sub(camera.position)
    .normalize()
    .multiplyScalar(distance);
  controls.maxDistance = distance * 10;
  controls.target.copy(center);

  camera.near = distance / 100;
  camera.far = distance * 100;
  camera.updateProjectionMatrix();
  camera.position.copy(controls.target).sub(direction);

  controls.update();

}

